import React from "react";
import IFrame from 'react-iframe';

const Frame = props => {
    return (
        <IFrame 
            url="https://fermentationist.github.io/ConsoleGame/"
            width="0"
            height="0"
            className="game-frame"
            >
            {props.children}
        </ IFrame>
    );
}

export default Frame;
